import 'dart:convert';
import 'geolocation.dart';

class Address {
  Geolocation? geolocation;
  String? city;
  String? street;
  int? number;
  String? zipcode;

  Address({
    this.geolocation,
    this.city,
    this.street,
    this.number,
    this.zipcode,
  });

  @override
  String toString() {
    return 'Address(geolocation: $geolocation, city: $city, street: $street, number: $number, zipcode: $zipcode)';
  }

  factory Address.(
      Map<String, dynamic> data) {
    return Address(
      geolocation: data['geolocation'] == null
          ? null
          : Geolocation
              .(
                  data['geolocation'] as Map<String, dynamic>),
      city: data['city'] as String?,
      street: data['street'] as String?,
      number: data['number'] as int?,
      zipcode: data['zipcode'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'geolocation': geolocation
          ?.(),
      'city': city,
      'street': street,
      'number': number,
      'zipcode': zipcode,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Address].
  factory Address.fromJson(String data) {
    return Address
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [Address] to a JSON string.
  String toJson() => json.encode(
      ());

  Address copyWith({
    Geolocation? geolocation,
    String? city,
    String? street,
    int? number,
    String? zipcode,
  }) {
    return Address(
      geolocation: geolocation ?? this.geolocation,
      city: city ?? this.city,
      street: street ?? this.street,
      number: number ?? this.number,
      zipcode: zipcode ?? this.zipcode,
    );
  }
}
